Я позитивный человек и хороший специалист. У меня есть любимая семья  и любимая работа.  В компании Инком Недвижимость я с 2006 года, а с 2013-го я являюсь руководителем офиса «Водный Стадион».
Риэлторской  деятельностью я занимаюсь уже более 20 лет, и  для меня  это действительно  является любимой работой. За все время я  воспитал не один десяток специалистов высокого уровня и многие из них уже много лет успешно работают в недвижимости.

Хотя  лично я считаю нашу работу  «образом жизни». Сложно в нашей профессии разделить «личное» и работу, да и многие мои клиенты и коллеги  давно  стали частью моей семьи. 
Как только  просыпаюсь – я уже на работе. В любой момент дня и ночи  кому-то срочно нужна моя помощь в области недвижимости - и я лечу на помощь как доктор из детской сказки. Я  так живу уже много лет: помогаю и защищаю всех, кто в этом нуждается.

Про своё любимое дело я знаю практически всё:
 Как правильно и выгодно продать  квартиру;
 Как удачно купить  недвижимость своей мечты;
 Как оптимизировать налогообложение по предстоящей сделке;
 В каком районе лучше купить хорошую квартиру;
 Как купить/продать квартиру из-под залога;
 Как одобрить ипотеку с выгодными процентными ставками;
 Как обменять квартиру с ипотекой, маткапиталом, субсидией и залогом.

И многое-многое другое. В недвижимости я пол  жизни и могу решить   любой  вопрос. 
Добавляйте  меня в друзья и я вам обязательно помогу!

Искренне Ваш, РО «Водный Стадион» Рыбаков Андрей Николаевич.

Одна-єдина, іншої такої просто не існує!!! :-)))
Принципи, за яким намагаюся жити:
- ніхто нікому нічого не винен;
- Всесвіт - справедливий, Бог - справедливий, усе має причину й наслідок;
- не заважай іншим жити так, як вони хочуть.
